import React from 'react';


class Case extends React.Component{
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className={"rond"+this.props.aorb} style={{backgroundColor: this.props.lol}} onClick={this.props.lol}>
      </div>
    );
  }
}

export default Case;
